import {
  ADD_TODO
} from '../actions/types'

const initialState = {}

const first = (state = initialState, action) => {
  let nextState = Object.assign({}, state)
  switch (action.type) {
    case ADD_TODO:
      nextState = action.payload
      return nextState
    default:
      return state
  }
}

export default first
